import React from "react";
import ReactForm from "./ReactForm";
import ImgUpload from "../ImgUpload";

function ProfileFormPage() {
  <label className="prof-input">
  return (
    <div>
      <h1>Upload Your Picture:</h1>
      <ImgUpload />
      <h1> Profile Form: </h1>
      <ReactForm />
    </div>
  );
  </label>
}

export default ProfileFormPage;
